pragma solidity ^0.4.23;

import "./Util.sol";
import "./EIP20/SafeMath.sol";

interface Token {
    function transfer(address _to, uint256 _value) external returns (bool success);
    function transferFrom(address _from, address _to, uint256 _value) external returns (bool success);
}

/*
  challenge : 0x6368616c6c656e676500000000000000000000000000000000
  compensate: 0x636f6d70656e73617465000000000000000000000000000000
 */
interface BoosterModule {
    function getName() external returns (bytes32 name);
    function run(bytes32[] _args) external returns (bytes32 result);
}

contract Booster {
    using SafeMath for uint256;
    mapping (address => bool) public assetAddresses;
    mapping (address => uint256) insurances;
    mapping (uint256 => Util.Stage) public stages;
    mapping (bytes32 => Util.Log) public depositLogs;
    mapping (bytes32 => Util.Log) public withdrawalLogs;
    mapping (bytes32 => address) public modules;

    uint256 public stageHeight;
    uint256 public instantWithdrawMaximum;
    uint256 public depositSequenceNumber;
    uint256 public stagePeriod = 86400;
    address public owner;
    address public goblin;
    address public managerAddress;
    address[] public assetAddressesArray;

    event ProposeDeposit (
        bytes32 indexed _dsn,
        bytes32 indexed _client,
        bytes32 _value,
        bytes32 _assetID
    );

    event VerifyReceipt (
        uint256 indexed _type, // { 0: deposit, 1: proposeWithdrawal, 2: instantWithdrawal }
        bytes32 _gsn,
        bytes32 _lightTxHash,
        bytes32 _fromBalance,
        bytes32 _toBalance,
        bytes32[3] _sigLightTx,
        bytes32[3] _sigReceipt
    );

    event Withdraw (
        bytes32 indexed _wsn,
        bytes32 indexed _client,
        bytes32 _value,
        bytes32 _assetID
    );

    event Attach (
        bytes32 _stageHeight,
        bytes32 _receiptRootHash,
        bytes32 _accountRootHash
    );

    event Finalize (
        bytes32 _stageHeight
    );

    event Challenge (
        uint256 indexed _challengedType, // { type: 1 - 4, 1: repeatedGSN 2: wrongBalance 3: skippedGSN 4: existProof }
        bytes32 _client,
        bytes32 _lightTxHash
    );

    event AttachBoosterModule(
        bytes32 _moduleName,
        address _moduleAddress
    );

    modifier onlyOwner () {
        if (msg.sender == owner) _;
    }

    modifier onlyGoblin () {
        if (msg.sender == goblin) _;
    }

    constructor (
        address _boosterOwner,
        address _goblin,
        address[] _assetAddresses,
        uint256 _instantWithdrawMaximum
    ) public {
        managerAddress = msg.sender;
        owner = _boosterOwner;
        goblin = _goblin;
        instantWithdrawMaximum = _instantWithdrawMaximum;
        stages[stageHeight].data = "genisis stage";

        for (uint i = 0; i < _assetAddresses.length; i++) {
            if (assetAddresses[_assetAddresses[i]] == false) {
                assetAddresses[_assetAddresses[i]] = true;
                assetAddressesArray.push(_assetAddresses[i]);
            }
        }
    }

    function setAssetAddress(address asAddress) public onlyOwner {
        if (assetAddresses[asAddress] == false) {
            assetAddresses[asAddress] = true;
            assetAddressesArray.push(asAddress);
        }
    }

    function unsetAssetAddress(address asAddress) public onlyOwner {
        if (assetAddresses[asAddress] == true) {
            assetAddresses[asAddress] = false;
            // remove asset address from assetAddressesArray
            for (uint i = 0; i < assetAddressesArray.length; i++) {
                if (assetAddressesArray[i] == asAddress) {
                    for (uint j = i; j < assetAddressesArray.length - 1; j++){
                        assetAddressesArray[j] = assetAddressesArray[j + 1];
                    }
                    delete assetAddressesArray[assetAddressesArray.length - 1];
                    assetAddressesArray.length--;
                    break;
                }
            }
        }
    }

    function getAssetAddressesLength() public view returns (uint256) {
        return assetAddressesArray.length;
    }

    function proposeTokenDeposit (bytes32[] _parameter) public {
        /*
        _parameter[0] = client
        _parameter[1] = value
        _parameter[2] = assetID
        */

        address assetAddress = address(_parameter[2]);
        require(assetAddresses[assetAddress] != false, "Asset address invalid.");
        address client = address(_parameter[0]);
        uint256 value = uint256(_parameter[1]);
        require(Token(assetAddress).transferFrom(client, this, value), "Approve failed.");
        writeDepositLog(_parameter);
    }

    function deposit (bytes32[] _parameter) public onlyOwner {
        bytes32 dsn = bytes32(_parameter[7]);
        require(Util.isLogValid(_parameter, depositLogs[dsn]), "Wrong deposit log.");
        require(Util.isSigValid(_parameter, stageHeight + 1, owner, goblin), "Wrong sig.");
        depositLogs[_parameter[7]].flag = true;

        emit VerifyReceipt (
            0,
            _parameter[12],
            _parameter[0],
            _parameter[13],
            _parameter[14],
            [
                _parameter[16],
                _parameter[17],
                _parameter[18]
            ],
            [
                _parameter[19],
                _parameter[20],
                _parameter[21]
            ]);
    }

    function proposeWithdrawal (bytes32[] _parameter) public {
        require(Util.isSigValid(_parameter, stageHeight + 1, owner, goblin), "Wrong sig.");
        /*
        wsn = concat(from + nonce)
        */
        bytes32[] memory bytes32Array = new bytes32[](2);
        bytes32Array[0] = _parameter[1]; // from
        bytes32Array[1] = _parameter[6]; // nonce
        bytes32 wsn = Util.hashArray(bytes32Array);

        withdrawalLogs[wsn].stage = bytes32(stageHeight + 1);
        withdrawalLogs[wsn].client = _parameter[1];
        withdrawalLogs[wsn].value = _parameter[4];
        withdrawalLogs[wsn].assetID = _parameter[3];

        emit VerifyReceipt (
            1,
            _parameter[12],
            _parameter[0],
            _parameter[13],
            _parameter[14],
            [
                _parameter[16],
                _parameter[17],
                _parameter[18]
            ],
            [
                _parameter[19],
                _parameter[20],
                _parameter[21]
            ]);
    }

    function withdraw (bytes32[] _parameter) public {
        /*
        _parameter[0] = from
        _parameter[1] = nonce
        */
        // flag = false
        bytes32[] memory bytes32Array = new bytes32[](2);
        bytes32Array[0] = _parameter[0];
        bytes32Array[1] = _parameter[1];
        bytes32 wsn = Util.hashArray(bytes32Array);
        require(withdrawalLogs[wsn].flag == false, "Withdraw already finish.");
        // over challenge time
        require (uint256(withdrawalLogs[wsn].stage) <= stageHeight, "No over challenge time");
        address client = address(withdrawalLogs[wsn].client);
        uint256 value = uint256(withdrawalLogs[wsn].value);
        bytes32 assetID = bytes32(withdrawalLogs[wsn].assetID);
        address assetAddress = address(assetID);
        if (assetAddress == address(0)) {
            client.transfer(value);
        } else if (assetAddresses[assetAddress] != false) {
            Token(assetAddress).transfer(client, value);
        } else {
            revert("Asset address invalid.");
        }
        withdrawalLogs[wsn].flag = true;
        emit Withdraw (wsn, bytes32(client), bytes32(value), assetID);
    }

    function instantWithdraw (bytes32[] _parameter) public {
        require(Util.isSigValid(_parameter, stageHeight + 1, owner, goblin), "Wrong sig.");
        // instantWithdraw condition
        require (uint256(_parameter[4]) <= instantWithdrawMaximum, "Withdraw value more than instant withdraw maximum.");
        /*
        wsn = concat(from + nonce)
        */
        bytes32[] memory bytes32Array = new bytes32[](2);
        bytes32Array[0] = _parameter[1]; // from
        bytes32Array[1] = _parameter[6]; // nonce
        bytes32 wsn = Util.hashArray(bytes32Array);

        require(withdrawalLogs[wsn].flag == false, "Withdraw already finish.");
        withdrawalLogs[wsn].stage = bytes32(stageHeight + 1);
        withdrawalLogs[wsn].client = _parameter[1];
        withdrawalLogs[wsn].value = _parameter[4];
        withdrawalLogs[wsn].assetID = _parameter[3];
        withdrawalLogs[wsn].flag = true;

        address client = address(_parameter[1]);
        uint256 value = uint256(_parameter[4]);
        address assetAddress = address(_parameter[3]);
        if (assetAddress == address(0)) {
            client.transfer(value);
        } else if (assetAddresses[assetAddress] != false) {
            Token(assetAddress).transfer(client, value);
        } else {
            revert("Asset address invalid.");
        }
        emit VerifyReceipt (
            2,
            _parameter[12],
            _parameter[0],
            _parameter[13],
            _parameter[14],
            [
                _parameter[16],
                _parameter[17],
                _parameter[18]
            ],
            [
                _parameter[19],
                _parameter[20],
                _parameter[21]
            ]);
    }

    function () public payable {
        /*
        called delegateToLib to 'proposeDeposit(bytes32[])'
        gas used : 127075
        gad used : 106627
        suggested gas : 150000
        */
        bytes32[] memory bytes32Array = new bytes32[](3);
        bytes32Array[0] = bytes32(msg.sender);
        bytes32Array[1] = bytes32(msg.value);
        bytes32Array[2] = bytes32(0);
        writeDepositLog(bytes32Array);
    }

    function tokenFallback(address _from, uint _value) public returns (bool success) {
        if(assetAddresses[msg.sender] == false) {
            revert("Asset address invalid.");
        } else {
            bytes32[] memory bytes32Array = new bytes32[](3);
            bytes32Array[0] = bytes32(_from);
            bytes32Array[1] = bytes32(_value);
            bytes32Array[2] = bytes32(msg.sender);
            writeDepositLog(bytes32Array);
            return true;
        }
    }

    function writeDepositLog (bytes32[] _parameter) private {
        /*
        _parameter[0] = client
        _parameter[1] = value
        _parameter[2] = assetID
        */

        depositSequenceNumber++;
        bytes32 dsn = bytes32(depositSequenceNumber);
        depositLogs[dsn].stage = bytes32(stageHeight + 1);
        depositLogs[dsn].client = _parameter[0];
        depositLogs[dsn].value = _parameter[1];
        depositLogs[dsn].assetID = _parameter[2];
        emit ProposeDeposit (dsn, _parameter[0], _parameter[1], _parameter[2]);
    }

    function attach (bytes32[] _parameter, bytes32[] _assetAddress, bytes32[] _feeValue) public onlyGoblin {
        require(_assetAddress.length == _feeValue.length, "Array length error.");
        /*
        _parameter[0] = _receiptRootHash
        _parameter[1] = _accountRootHash
        _parameter[2] = _data
        */
        require(stages[stageHeight].finalizeTimeStamp != 0 || stageHeight == 0, "Can not attach new stage until current stage has been finalized.");
        stageHeight++;
        stages[stageHeight].receiptRootHash = _parameter[0];
        stages[stageHeight].accountRootHash = _parameter[1];
        stages[stageHeight].data = _parameter[2];
        stages[stageHeight].attachTimestamp = block.timestamp;
        for (uint i = 0; i < _assetAddress.length; i++) {
            stages[stageHeight].fee[address(_assetAddress[i])].value = uint256(_feeValue[i]);
        }
        emit Attach (bytes32(stageHeight), _parameter[0], _parameter[1]);
    }

    function getFeeWithStageHeight (uint256 _stageHeight) public onlyGoblin {
        require(_stageHeight <= stageHeight, "No over challenge time.");
        //ETH fee
        uint256 ethFeeValue = stages[_stageHeight].fee[address(0)].value;
        bool isFeeWithdrawed = stages[_stageHeight].fee[address(0)].withdrawed;
        if (isFeeWithdrawed == false && ethFeeValue > 0) {
            stages[_stageHeight].fee[address(0)].withdrawed = true;
            goblin.transfer(ethFeeValue);
        }
        // Token fee
        for (uint i = 0; i < assetAddressesArray.length; i++) {
            address assetAddress = assetAddressesArray[i];
            isFeeWithdrawed = stages[_stageHeight].fee[assetAddress].withdrawed;
            uint256 tokenFeeValue = stages[_stageHeight].fee[assetAddress].value;
            if (isFeeWithdrawed == false && tokenFeeValue > 0) {
                stages[_stageHeight].fee[assetAddress].withdrawed = true;
                Token(assetAddress).transfer(goblin, tokenFeeValue);
            }
        }
    }

    function challenge(bytes32[] _receipt1, bytes32[] _receipt2) public {
        // check if receipt1 already challenged
        require(!checkStateChallenge(_receipt1[12]), "Receipt has already been challenged");

        // todo: merge 2 receipt and slice to one array
        bytes32[] memory challengeData;
        uint8 result = uint8(callModule(0x6368616c6c656e6765, challengeData));
        if(result > 0) {
            challengeSuccess(_receipt1[12], _receipt2[12], result);
        }
    }

    function challengeSuccess(bytes32 _gsn1, bytes32 _gsn2, uint8 _challengeLevel) private {
        stages[stageHeight].challengedInfos.push(
            Util.ChallengedInfo(bytes32(msg.sender), [_gsn1, _gsn2], true, false, _challengeLevel)
        );
        stages[stageHeight].challengedGsn[_gsn1] = true;
        emit Challenge (_challengeLevel, bytes32(msg.sender), _gsn1);       
    }

    function checkStateChallenge(bytes32 gsn) public view returns(bool) {
        return stages[stageHeight].challengedGsn[gsn];
    }

    // deprecated function (only for QA)
    function setStagePeriod (uint256 period) public {
        stagePeriod = period;
    }

    function checkStageTimeout () public view returns (bool) {
        return block.timestamp > stages[stageHeight].attachTimestamp + (stagePeriod * 3/2);
    }

    function finalizeStage () public onlyGoblin {
        // challenge time = 0.2 * stagePeriod Time.
        Util.Stage memory currentStage = stages[stageHeight];
        require(
            currentStage.attachTimestamp > 0 &&
            block.timestamp > currentStage.attachTimestamp + (stagePeriod * 1/5),
            "Can't finalize until challenge time up."
        );
        require(currentStage.finalizeTimeStamp == 0, "already finalized.");
        for (uint i = 0; i < currentStage.challengedInfos.length; i++) {
            require(currentStage.challengedInfos[i].challengedState == true, "Challenge hasn't been closed.");
        }
        stages[stageHeight].finalizeTimeStamp = block.timestamp;
        emit Finalize (bytes32(stageHeight));
    }

    function getInsuranceBalance(address tokenAddress) public view returns (uint256) {
        // what if eth?
        require(assetAddresses[tokenAddress] == true, "token not supported");
        return insurances[tokenAddress];
    }

    function putInsurance(address tokenAddress, uint256 amount) public payable {
        if (msg.value != 0) {
            // received Eth
            insurances[address(0)] = insurances[address(0)].add(msg.value);
        } else {
            // received erc20 and erc223
            require(assetAddresses[tokenAddress] == true, "token not supported");
            require(Token(tokenAddress).transferFrom(msg.sender, this, amount), "Approve failed.");
            insurances[tokenAddress] = insurances[tokenAddress].add(amount);
        }
    }

    function attachBoosterModule(bytes32 moduleName, address moduleAddress) public onlyOwner {
        modules[moduleName] = moduleAddress;
        emit AttachBoosterModule(moduleName, moduleAddress);
    }

    function callModule(bytes32 moduleName, bytes32[] params) internal returns(bytes32) {
        bytes32 result = BoosterModule(modules[moduleName]).run(params);
        return result;
    }
}
